import Button from "../Button"
import { Link } from 'react-router-dom';



export function ShowAdmins({adminList}) {

    return (
      <div>
        <table className="table table-striped">
                            <thead classNameName=''>
                              <tr>
                                  <th>Id</th>
                                  <th>Full Name</th>
                                  <th>Phone</th>
                                  <th>Email</th>
                                  <th>Password</th>
                                  <th>
                                  <Link to="/index/admins/new">

                                  <Button
                  color=""
                  bgColor="var(--primary-color)"
                  name="Add Admin"
                  id="addAdminBtn"
                  className="btn px-4"

                />
                </Link>
                                  </th>

                              </tr>
                            </thead>
                              <tbody id="tableDataField">

                              {adminList.map((item)=>{
                                return(
                                <tr>
                                  <td>{item.id}</td>
                                  <td>{item.fullName}</td>
                                  <td>{item.phone}</td>
                                  <td>{item.email}</td>
                                  <td>{item.password}</td>
                                  <td>
                                  <Link to="/index/admins/edit"><Button
                                    color=""
                                    bgColor=''
                                    name="Edit"
                                    id={item.id}
                                    className="btn editBtn"

                                  />
                                  </Link>

                                  <Link to="/index/admins/delete"><Button
                                    color=""
                                    bgColor=''
                                    name="Delete"
                                    id={item.id}
                                    className="btn deleteButton btn btn-customized text-center px-5"
                                  />
                                  </Link>
                                  </td>
                              </tr>
                                )

                              })}
                              </tbody>

        </table>
        </div>

    )
  }

export function NewAdmin() {
    return (
      <div>New Admins</div>
    )
  }

  export function DeleteAdmin() {
    return (
      <div>Admin Deleted</div>
    )
  } 

export function EditAdmin() {
return (
    <div>Edit Admin</div>
)
  }
